  false,\n\t\"url\": null,\n\t\"notes\": \"GPS waypoints delineating the flight paths
  for low altitude transects from a Garmin GPS unit. Transects were conducted from
  small aircraft over the National Park Serviceu2019s Arctic Network (Bering Land
  Bridge National Preserve, Cape Krusenstern National Monument, Gates of the Arctic
  National Park and Preserve, Kobuk Valley National Park, and Noatak National Preserve)
  and the U.S. Fish and Wildlife Serviceu2019s Selawik National Wildlife Refuge in
  northwest Alaska. Positions were collected at five second intervals.\",\n\t\"license_title\":
